import react, { Component } from 'react'
import JWTService from './JWTService';


class Logout extends Component
{
    constructor(props) {
        super(props)

        this.state = {
        }       
        
        this.logoutServices = this.logoutServices.bind(this)
       
    }
    logoutServices()
    {
        JWTService.logout();
        this.props.history.push('/')
    }
}

export default Logout;
